import React from "react";

export default function index() {
  return (
    <div className="container">
      <nav>
        <ul>
          <li>
            <a>Contact Me</a>
          </li>

          <li>
            <a>Projects</a>
          </li>

          <li>
            <a>Home</a>
          </li>
        </ul>
      </nav>

        <h1>Hey I am Olalekan</h1>
        <p> Aspiring Full Stack Developer</p>
        <style jsx>
          {`
            .container {
              margin: 50px;
              background:lightblue;
            }
            p {
              color: blue;
            }
          `}
        </style>
      </div>

  );
}
